this.options.events['keydown'] = function(e) {
  //正答キーを指定
  let correctKey;
  let incorrectKey;
  if(this.parameters.examplarCategory == "concept1" |
  this.parameters.examplarCategory == "attitude1"){
    correctKey = "j"
