//値の変換の関数を作成
function convertRTs(RTs){
  for(i = 0; i < RTs.length; i++)
  {
    if(RTs[i] < 400)
    {
      //400msに変換
      RTs[i] = 400
    }
    else if(RTs[i] > 2000 && RTs[i] < 10000)
    {
      //2〜10秒の場合は2秒に変換
      RTs[i] = 2000
    }
    else if(RTs[i] >= 10000)
    {
      //10秒以上の場合は除外
      RTs[i] = 0
    }
  }
  //0を除外
  RTs = RTs.filter(n => n !== 0);
  return RTs;
}

